const resolvers = {
  Query: {
    getColors: () => colors,
    getColorsByTitle: (_, { title }) =>
      colors.find((color) => color.title == title),
  },
  Mutation: {
    updateColor: (_, { id, title, text, img }) => {
      const Color = {
        id,
        title,
        text,
        img,
      };
      colors[id - 1].id = id;
      colors[id - 1].title = title;
      colors[id - 1].text = text;
      return Color;
    },
  },
};

module.exports = resolvers;
